margin-top:80px;

`;

const TextFieldForm = styled(TextField)`
// background-color:red;
`;

export default function Home() {
  return (
    <MainPage>
    <form>
      <TextFieldForm id="standard-basic" label="Coloumn Name" />
    </form>       
    </MainPage>
  );
}
